synchronized long getStartTimeFor(DB db) {
  long startTime = -1;
  for (Map.Entry<Long, DB> entry : rollingdbs.entrySet()) {
    if (entry.getValue() == db) {
      startTime = entry.getKey();
    }
  }
  return startTime;
}
